import React from "react";
import "./HeroCard.css";

function HeroCard(props) {
  return (
    <div className="card"
     value={props.id} 
     onClick={() => props.handleClick(props.id)}
     >
      <div className="img-container">
        <img alt={props.name} src={props.image} />
      </div>
    </div>
  );
}

export default HeroCard;
